export const initialState = {
    name: '',
    password: '',
    email: ''
}

const CONSTANT = {
    USERNAME: 'username',
    PASSWORD:'password',
    EMAIL:''
}
export const reducer = (state, action) => {
    switch (action.type) {
        case 'USERNAME':
            console.log('object')
            break;
        case 2:
            console.log('object')
            break;
        case 6:
            console.log('object')
            break;
        default:
            console.log('object')
    }
}
